import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

import HomeScreen from "./screen/HomeScreen"
import ItemDetail from "./screen/ItemDetailScreen"
import ItemBuy from "./screen/ItemBuyScreen"
import Menu from "../menuComponent/menu/MenuComponent"
import 'bootstrap/dist/css/bootstrap.min.css';
import React, {useState,useEffect} from 'react';

const Routing = () => {
    return(
        <Router>
            <Menu />
            <Switch>
                <Route path="/" component={HomeScreen} />

                <Route path="/details" component={ItemDetail} />

                <Route path="/buy" component={ItemBuy} />
            </Switch>
        </Router>
    );
}

export default Routing
